export const email = {
  regex: /\w+@\w+\..+/g,
  message: "Este email não é válido",
};

export const number = {
  regex: /^\d+$/,
  message: "O campo só aceita numeros",
};

export const obrigatorio = true;

export const semValidacao = false;
